import React from "react";
import ReactDOM from "react-dom";
// import './index.css'

let Frame ={
  width: '1450px',  
  height: '1079px',
  borderRadius: '70px',
  background: '#B6ECBB'
}





let hour = new Date().getHours()
let greet = "null"
if(hour > 0 && hour < 12){
  greet = "Good Morning"
}
else if(hour >= 12 && hour < 18 ){
  greet = "Good Afternoon"
}
else{
  greet = "Good Night"
}

ReactDOM.render(
  <>
  <div style={Frame}>
    <div className="Block">
      <div className="helo">Hello Sir,</div>
      <div className="time">{greet}</div>
    </div>
  </div>
  </>,
  document.getElementById("root")
)
